			["zone"] = "Dalaran - The Eventide",
			["misc"] = {
				["ST"] = {
					["1"] = 2,
					["3"] = 2,
					["2"] = 3,
					["5"] = 4,
					["4"] = 3,
					["6"] = 0,
				},
				["PE"] = {
					["1"] = {
						["AC"] = true,
						["TI"] = "Dashing",
						["TX"] = "Absolutely flamboyant.\n\n[Outfits and art in 'About'!]\n\nThe voice is deep and warm, the tone sarcastic or gleeful, the stride assured - talking and walking as if he owned the cosmos. He is rather short for a Kaldorei male, but the swaggering bravado certainly makes up for the height.\n\nThe features are expressive, youthful and handsome, framed with starry white hair. He radiates of charm, and seems untouched by the passage of time - except discrete wrinkles on the corner of his eyes when he smiles.\n\nThe eyes themselves are almond-shaped, flaming and shimmering purple, indicating a long and probably mutually abusive relationship with the Arcane. \n\nUnder his skin, sometimes, streams of purple energy randomly shoot and glow, like pulsating veins. Surely, he has it totally under control.\n",
						["IC"] = "ability_racial_arcaneaffinity",
					},
					["3"] = {
						["AC"] = true,
						["TI"] = "Smells like new money / Dresses like fake royalty",
						["TX"] = "At first sight, he talks, looks and dresses like a Highborne, and is certainly old enough to be one. Humans and other races will definitely assume this one comes straight out of a fancy academy from the glory days of the Kaldorei Empire.\n\nBut actual Highborne would notice a few details betraying his true origins and class: he is not quite as tall and slender as most nobles in the azsharian times, has the sturdy hands of a soldier or a craftsman, a nonchalant and rather unrefined stance, and a hint of popular suramarian accent in his voice when he is flustered, enthusiastic, or drunk. And his clothes? A bit -too much-.\n\nIf the subtleties do not give it away, his old habit of uttering profanities, glaring at nobles, slamming his boots on various counters and uncorking bottles with his teeth will: this one may have climbed the social ladder, but he was born at the very bottom of it.\n",
						["IC"] = "inv_archaeology_70_highborne_prewartapestry",
					},
					["2"] = {
						["AC"] = true,
						["TI"] = "Metal hand, monocle and trinkets",
						["TX"] = "His distinctive monocle, ancient-looking and enhanced with both mechanical and magical tricks, sits permanently on his right eye - sometimes illusioned as a pair of snazzy round shades, or deployed into grotesquely intricate goggles.\n\nHis left hand has been replaced with a very remarkable metallic silver gauntlet, adorned with purple gems and radiating with a striking power; to those familiar with it, its ethereal origins will appear obvious.\n\nHis ears, from lobe to point, are clicking and shining with countless earrings of azsharian fashion. A closer look would reveal that it's not actually silver, rather relatively cheap copies.\n\nHe also wears a wedding bracelet, and a sigil ring bearing the emblem of the Kirin Tor.\n\nMost often than not hidden under his cuffs, two golden bracers inlaid with a single scale. They reek of temporal magic.",
						["IC"] = "inv_glove_cloth_raidmagemythic_s_01",
					},
					["5"] = {
						["AC"] = true,
						["TI"] = "\"Oh, yes, that guy\"",
						["TX"] = "The citizens of Dalaran and beyond know him, vaguely, as an \"official\". He has the insignia, the interns, the bodyguards and everything, is sometimes seen lecturing or promoting his academic works, and is featured in a number of newspapers (The Leaky Quill, the Lion's Roar, the Dalaran Observer and the Citadel's Whispers).\n\nKaldorei as old as him might recognise him as a former eccentric teacher of chronomancy in Zin-Azshari, Suramar, Eldre'thalas and Nar'thalas.\n\nGutter dwellers might know him for his love of brawls, taverns, casinos and black markets.\n\nOnly high-ranking officials of the Kirin Tor have the full picture: the chronomancer is an ex-criminal exiled from the post-Sundering Kaldorei society, a 'reformed' cosmic vigilante turned inquisitor, then intelligence operative in Dalaran.\n\nWith all this and more, they will know that contrary to appearances, the Director is an extremely cunning and dangerous individual.\n\n(More in About)\n",
						["IC"] = "achievement_reputation_kirintor_offensive",
					},
					["4"] = {
						["AC"] = true,
						["TI"] = "Aura and illusions",
						["TX"] = "For a mage going about their day in peace, meeting this Kaldorei's aura at the turn of a building would be like a golden, invisible slap right across the kisser.\n\nHe absolutely reeks of temporal magic, to a worrying extent; and if he is not a Bronze gone mad, he is most definitely a chronomancer gone bananas.\n\nOn a more subtle level, a good (magic) eye could spot an illusion anchored to a medallion around his neck. A surprisingly masterful illusion, well-crafted and complex, that hints at a mastery the chaotic aura did not give away - perhaps on purpose.\n\n(Whisper for more details) ",
						["IC"] = "ability_racial_forceshield",
					},
				},
				["v"] = 88,
			},
		},
