				["T3"] = {
					["PH"] = {
						["BK"] = 1,
					},
					["PS"] = {
						["TX"] = "{col:ffffff}\nHaving lived much of his youth in a trading hub, Golgak grew very much isolated and ignorant of orcish heritage. At times he does appear out of place compared to his peers. Being relatively young, and a greenhorn when it comes to the war effort; his knowledge of outside of Durotar comes from secondhand rumors and daily papers. \nLiving amongst goblins and the other races, Golgak would notice a trend. A discovery perhaps. Honor, wisdom and valor; are all virtuous traits. However, when it came to true power, the key was the resources and wealth. Not the stoic leadership and valor his orcish peers would stand and die by.\n\n\n{/col}",
						["BK"] = 6,
					},
					["HI"] = {
						["TX"] = "{col:ffffff}\nGolgak’s personal career starts from ratchet, where he would find a steady stream of odd jobs. There was always a new face that needed something moved. Whilst carrying shipments and arranging cargo, he would continually find himself eavesdropping on passersby to the town. Speaking of grand tales which were always exaggerated to a fault no doubt. This would keep the young orc busy for a time, and for a while content. But like all mundane occupations, dreariness would set in. Resentment would fall in, soon he would feel the better amongst his menial peon peers. \nThe wake of the fourth war would bring all but a halt to intercontinental trade. Due to the cities proximity and access to the capital, making it a center port for an invasion. The once booming commerce of the neutral city came to grinding downturn. \nThis did not deter Golgak, who believed he would be destined for more than a mere deckhand. In a way the Orc believed this was a sign. A sign to search for a bigger, better destiny. With his trusty coin bag in hand, and few necessary valuables he needs. Golgak trekked all the way to the capital Orgrimmar, in hopes of finding an occupation that suits his ‘worth’. \n\n\n{/col}",
