			["about"] = {
				["v"] = 2,
				["BK"] = 8,
				["TE"] = 1,
				["T1"] = {
					["TX"] = "A dazzling display of purples and pinks are the first thing immediately noticeable about this magus. She would claim that all magi must dress their finest and be bold and it certainly does make her stand out from the crowd, for better or worse.\n\nOften seen wearing a crown with a icy blue gem in the center. Normally it exhibits only a dull glow but in the midst of fierce spellcasting, it glows brighter, even sending out small sparks of energy on occasion.\n\nHer robes seem to be made from a very high quality matieral, comfortable, yet durable to withstand one or two blows, but that's all. Her staff has a robust design, with a hint of a frost enchantment to it and a core of amber in the center. Made from a metal, it is presumably strong enough to serve as a melee weapon in the desperate times.\n\nHer expression is usually passive, though sometimes curious, such is the nature of most magi. As you'd expect from the majority of blood elf maidens, her physical appearance is that of beauty, which ironically makes her rather plain when standing besides her kin. Her eyes are her most charming feature, always looking about, searching or examining the next mystery. When she speaks, her tone is typically a light one, though it harbors an undertone of confidence.\n",
				},
