			["about"] = {
				["TE"] = 1,
				["T1"] = {
					["TX"] = "{img:Interface\\FlavorImages\\BloodElfLogo-small:256:256}\n{h3:c}History:{/h3}\n\nBorn 417 years ago in a noble family in Eversong Woods, Elfora Amberleaf never felt like she fits in the high elven society and tries all her best to stay away from it's stern restrictions. She was and still is the favourite child of her family. The little elf loved to secretly pick her father's sword and pretend she's a mighty knight, until one day she didn't knew she was watched carefully by him from afar. And this is when her dance with hevy steel began. It was the only thing that occupied her mind at the time, she was obsessed by slicing open the dummy's cloth bodies. \n\n{h1:c}{icon:inv_offhand_sunwell_d_01:25}{/h1}\n{h3:c}Blood Knight:{/h3}\nThanks to her father's acquaintance with Astalor Bloodsworn (a master magi) and his help with the imprisonment of the naaru M'uru under Silvermoon, Elfora became a member of the Blood Knight order alongside her father couple of years ago. When she drained power straight from the naaru, she received a variety of light-based abilities aside from that of martial prowess, but after his death and the restoration of the Sunwell, the closer she is to her homelands, the more powerful her abilities are. \n- During Legion, she followed Lady Liadrin and helped with the other Blood Knights in the rebellion of the Highbourne in Suramar. \n- In the Fourth War, she fought in Arathi Highlands during the Battle for Stormgrade.\n\n{h1:c}Currently:{/h1}\nElfora is back in her homeland, putting aside her missions with the paladins of the Blood Knights order, because of a recent theft in her family home. She's trying to help her family resolve the case and put justice to whoever wishes to cause them harm. \n\n{img:Interface\\QuestionFrame\\answer-warfronts-horde-BristlingPower:256:128}",
