						["BK"] = 1,
						["TX"] = "{img:Interface\\PVPFrame\\Icons\\prestige-icon-8-4:128:128}\n{h1:c}|cffddffefJaigro the Explorer|r{/h1}\n\n{h3:c}|cffff694f [The Cinematic Universe of Jaigro Art]( https://imgur.com/a/nkiaIwo )|r{/h3}\n\n{h3:c}|cffff694f [Grand illustration celebrating my 15 years with Warcraft - Made by M.Brackett]( https://imgur.com/a/Q3YxuH0 )|r{/h3}\n\n\n\n{img:Interface\\QUESTFRAME\\UI-HorizontalBreak:256:64}\n\n\n{h1:c}|cffddffef-Character Content-|r{/h1}\n\n\n{h3:c}|cff6177ff\"We are doomned...this is the end...\"|TInterface\\Icons\\inv_tourofdutyvoldun:20|t|r{/h3}\n{h3:c}|cff6177ff\"You will -never- take us alive!\"|r{/h3}\n\n\n{p:c}|cffa9baffJaigro can often be seen:\n\nReading a book - |TInterface\\Icons\\inv_misc_book_04:20|t\nMeditating - |TInterface\\Icons\\ability_mage_studentofthemind:20|t\nWriting in his journal - |TInterface\\Icons\\inv_artifact_tome02:20|t\nPracticing arcanic spells - |TInterface\\Icons\\spell_arcane_studentofmagic:20|t\nEating their favorite foods - |TInterface\\Icons\\inv_misc_noodle_soup_intermediate_level:20|t\n|r{/p}\n{img:Interface\\QUESTFRAME\\UI-HorizontalBreak:256:64}\n\n{h3:c}|cffddffefSnippets of History|r{/h3}\n\n{h2:c}|cff87acffYear 34|r{/h2}\n|cffff9775Somewhere in the sands, Vol'dun. |r\n|cffffd997One day during an expedition out north of Vol’dun, at the court of Zak'rajan, Jaigro was tasked to oversee a group of excavators when they were ambushed and captured by the so-called faithless. He woke up some hours after the ambush in the shrouded hollow with only 2 of the group members in cages next to him. A first instinct to break free was quickly diminished as Jaigro saw a handful of guards coming closer and he was noticed that he was awake. Within the following week, as he saw the aggressive acts of the Sethrak on newly a captured Vulpera warrior, he heard rumbling acts of earth movements down way of the entrance of the cave and seconds later an orc came running in, using magic to shift the earth around the Sethrak guards to throw them down with an act of lightning to knock them out afterward. Amazed, Jaigro broke free of the cage he was in and quickly thanked the orc who also freed the other Vulpera in the cave. The orc asked him to join his group and free the rest of the Vulpera in the area and of course, Jaigro agreed with a smile and followed the orc towards the exit of the cave. “I didn’t expect anyone other than Sethrak until I would see my end, why are you here in Vol’dun stranger?”. “I am looking for a female Zandalari guard, I came with here to Vol’dun to look for someone, but we got struck down by the Sethrak”.|r",
