			["about"] = {
				["v"] = 43,
				["BK"] = 6,
				["TE"] = 1,
				["T1"] = {
					["TX"] = "{img:Interface\\Pictures\\artifactbook-demonhunter-cover:180:180}\n{h1:c}Nidarosis{/h1}{h3:c}-Cinderbloom-{/h3}\n{h3:c}How it began{/h3}\n{p:c}Former \"Concubine\" in Den of Mortal Delights, who was sent to serve in the Black Temple along with other blood elves by Kael'thas as a sign of his loyalty to the Illidari. During her time there, the temple became her new home and the illidari her family.{/p}\n{p:c}She lost many dear to her heart during the many outside raids of the temple. One of them being one of her closest friends, a human concubine named Carys. This lead Nidarosis, whom had little to no previous skill to go through intensive training to be allowed into the Demon hunter training. The risk of death during her training and transformation was high, but her determination and help from the illidari pushed her through many defeats and serious injuries. Though she is far from the strongest Demon Hunter, her goal was to be just strong enough to be able to protect her newfound family against the threats of Azeroth.{/p}\n{p:c}Now that Sargeras is imprisoned, she feels a bit lost as to where she belongs. As much as she originally wished to return to the Black Temple, she now finds herself feeling comfortable in Orgrimmar surrounded by friends.{/p}\n{h3:c}Looks{/h3}\n{link*https://imgur.com/a/5og7Xog*Album link, art by me}\n{link*https://pbs.twimg.com/media/ETE94E4XkAEBDei?format=jpg&name=4096x4096*Art by harmonious_rain @ Twitter}\n{link*https://pbs.twimg.com/media/ER6P2UbU4AAhgnc?format=jpg&name=large*Art by KittyCatKissu @ Twitter}\n\n{p:c}She is a rather good looking elf, but the transformation has left her with fel scars spread across her body and face, along with the skin on her limbs fading into a purple hue with a scale like apperance. Her hair recently cut to shoulder length.{/p}{img:Interface\\PVPFrame\\Icons\\prestige-icon-8-3:100:100}\n{h3:c}Players note{/h3}\nNida's past as a concubine does not mean I want to do ERP. It's just a story from her past about HOW she became a demon hunter. I will not change that part of her story just because some people assosiate concubines with ERP.\n\n",
				},
			},
