			["about"] = {
				["T3"] = {
					["PH"] = {
						["IC"] = "inv_misc_firedancer_01",
						["BK"] = 1,
						["TX"] = "By Vulpera standards, Arra would be considered high above average in terms of her appearance. Her features are sleek and defined and her body is very fit thanks to her many MANY dancing sessions and can easily turn heads in a crowd. Her white fur and tail always looks well-kept and clean and sometimes even smell of flowers or other pleasant fragrances as she takes great care of her personal hygiene.\n",
					},
					["PS"] = {
						["TX"] = "At first glance Arra comes off as a calm and secure person who generally tends to at least try to keep herself out of trouble. Though a bit quiet at times she is often seen with a smile on her face and is happy to speak with friends and strangers alike, and despite being someone who is acquainted with the more darker kinds of magic she is  a very friendly soul to who treats people with kindness.\n\nAs a result of her time as a slave dancer Arra can be just as seductive as she is friendly often speaking in well-mannered and sometimes suggestive tones without even realizing it as it is something she has been thought to do often. She also relies quite heavily on physical contact to show trust, things like a friendly pat on the back or shoulder, handshakes, hugs and sometimes even some light massaging.\n\nArra tries more often than not to find more diplomatic solutions to conflict first as she is not a skilled fighter even with her magic’s and relies more on words or manipulation to survive, something she picked up from her old master.\n\nDespite her kind nature Arra does carry some darker thoughts with her due to her losing her family and being mentally abused as a slave. Having been left powerless to protect her family from death and enslavement and then being manipulated and betrayed by her supposed caretaker has left Arra with an inferiority complex that she constantly tumbles with, causing her to seek power in any form that she thinks she can control and takes comments about her abilities to heart. Due to her lack of skill in combat however Arra is more often than not beaten into a pulp reinforcing the idea that she needs more power, not only to defend herself but more importantly to protect those close to her. \n\nThis frustration can sometimes boil over and Arra’s magic runs wild often seen as bluish shadows surrounding her entire body. In this state her personality grows more choleric and her words are filled with anger and frustration and she can at times even sound mocking. Though this state doesn’t affect Arra’s performance in battle much it does make her more aggressive and seemingly more confident in her abilities. This is at the same time her biggest weakness as she lets her emotions take over her otherwise calm judgement. \n\n",
						["BK"] = 1,
					},
					["HI"] = {
						["TX"] = "\n{h2:c}Backstory{/h2}\n\n\nArra’s caravan was attacked by Sethrak and most of its members were killed or sold as slaves. Arra herself was sold to a wealthy Sethrak woman who saw her as an object of value, a value that could be increased with proper care and maintenance. She gave Arra clothes, food and a place to sleep and in turn Arra would be her servant, though she didn’t say exactly how Arra would serve her at first only that she had to follow her commands.\n\n\nThe first few weeks Arra’s new mistress helped her regain her strength as the Vulpera was very weak from her time in the harsh conditions of the slave pens. Though she was uncertain what her mistress’s motives were Arra wouldn’t deny herself food that was served to her on a platter, even if it was from a Sethrak. Soon enough Arra’s strength returned and not long after her life as a servant began proper.\n\n\nFirst she was told and taught to do simple things like cleaning and cooking. Cleaning was simple enough raging from dusting to scrubbing floors but cooking proved to be a bit of a challenge for Arra as she was so used to barely scraping by when it came to food out in the dunes, now she had to make food for Sethrak and had a lot more ingredients, fresh ingredients on top of that to work with. But with hard work she eventually got accustomed to this change and became a decent chef.\n\n\nNext up on the list was proper hygiene something that wasn’t exactly a foreign concept to Arra but the best she had gotten before was perhaps a dip in an oasis if she was really lucky, Now she was told to bathe in hot water, use different oils and sometimes different flowers that made her fur smooth and smell of floral. This according to her mistress was the most important thing Arra had to do every day before anything else as how she looked was reflected by her owner’s wealth.\n \nThis cleaning routine is something Arra is still doing every day even after getting her freedom back as it has more or less have become ingrained into her mind and she can become very uneasy if she hasn’t washed herself in a while.\n\n\nLastly Arra’s mistress taught her how to entertain, primarily through exotic dance but also music as both tend to be used together. While she was very uncomfortable with the idea at first dancing in general became something Arra enjoyed exotic or not.\n\n\nThis was Arra’s status que for a while spending most of her days serving her mistress in whatever way she saw fit and even though Arra missed her family and freedom she had seen how cruel the Sethrak commonly was towards her people, treating them as “pets” or working them to death so to ensure her own survival she did as she was told. \n\n\nSometime later however Arra found out why her mistress had treated her so well and taught her these things. She was an investment, a pretty doll to be toyed and played with and something her mistress planned to sell off to the highest bidder either as a plaything or to someone who bred her kind for more slaves. It was at that moment Arra realized how brainwashed she had become, she had blindly been serving initially out of fear but later in the hopes that her mistress was a good person, but there was no love or kindness behind her actions only greed. But she was the only person Arra had left. \n\n\nFortunately the Horde arrived in Vol’dun and freed the Vulpera from the Sethrak’s oppression before her mistress plan could come to fruition, and seeing her world of wealth crumble before her very eyes broke her down completely. Despite feeling betrayed and now mentally abused by her owner Arra couldn’t bring herself to harm her mistress as she owed her life to the snake woman despite the ulterior motives she had for her actions. Telling her now former owner to get out and run to safety with the rest of the upper class citizens Arra grabbed her mistress’s old Serpent staff and fled during the ensuing battle. \n\n\nSometime later Arra caught word that some of her people had begun to leave Vol’dun to join the Horde as thanks for their help. She joined up with one of the many caravans that was traveling towards Kalimdor and the capital city of the Horde. Ogrimmar. \n\n\n{h2:c}Current Events{/h2}\n\n{h3}Chapter One{/h3}\n\nShortly after arriving in Ogrimmar Arra met a group of fellow Vulpera calling themselves the Southwind Nomads who invited her to join them. Though initially unsure of what use she would be to them Arra soon found her place within the group as one of their mystics and traveled with them for a while. Their time mostly spent exploring and traveling to different cities and marketplaces, selling things they made themselves or found during their travels. \n\nUnfortunately the group eventually dissolved and Arra once again found herself alone looking for some sort of purpose or use for her skills.\n\n\n\n{h3}Chapter Two{/h3}\n\nAfter about a month of looking around in Ogrimmar Arra ran into someone that offered to teach her how to improve her magical abilities along with work that would earn her some decent coin in the meantime. Arra accepted the offer and signed a contract with the undead warlock and was scolded by them shortly after for signing without reading the contents of it. \n\nIn the weeks that followed Arra worked for the company her new teacher was a part of, a company mainly run by goblins called the Copper Street Solutions but she also fund fellow Vulpera and other races within the company. The company itself focused mainly on working as hitmen, deliverers of different goods, explores, but Arra found out later that the company leaned a little on the criminal spectrum as well as they had to do some dirty work from time to time. Arra initially helped the company out because her teacher told her to as that was a part of their contract and in return she would be taught the ways of magic starting with shadow magic as she had experience with that. But she eventually grew quite fond of the members of the company during their many missions. \n\nEverything was well for a few weeks  and Arra’s days consisted mostly of working for the Copper Streets and studying under her new master, but her studies was abruptly put on hold when her teacher got accused of having a contract with a demon lord and got banished from Ogrimmar and eventually a bounty was put on his head.\nStill Arra was able to keep in contact with her teacher trough the grimoire he had given her and her studies continued outside any of the horde capitals. \n\nUnfortunately it was not meant to last and Arra’s teacher was hunted down and killed forcing Arra to continue her studies on her own, and even though she enjoyed her time with the Copper Street Solutions Arra ultimatly decided to take her leave from the company feeling that she had gotten enough experience to handle herself.\n ",
