						["IC"] = "inv_polearm_2h_nazmirraid_d_01",
						["TX"] = "A spear improved with goblin- and titan tech.\n\nA shield, improved with gadgets and imbued with a proto drake scale. Powered by a titan core.\n\nSome sticks of dynamite on his belt, as well as a bendy old wand, rope, and a special ice pick with \"Ashen Ghost\" engraved on the handle.\n",
