						["TX"] = "Current:\nFresh scar on his chin\n\n\nOld:\nObvious scarring where a large piece of flesh was torn from his lower jaw & stitched back on.\n\nScar where his nose ring got ripped out.",
					},
					["4"] = {
						["AC"] = true,
						["TI"] = "Presentation",
						["IC"] = "inv_alchemy_80_potion02orange",
						["TX"] = "Pekun's right ear is sporting a large decorative(?) ear cuff.\n\nWearing \"Fresh Brew\" cologne, smelling of coffee, musk and cedar, with a slight chocolaty note.\n\nOn his left wrist he wears a watch, which also functions as a radio.\n\nUnderneath his armor he's wearing a necklace made of dragon teeth and a single owlkin feather.\nAnd on a silver chain around his neck, dangles a silver diamond ring.\n",
