				["v"] = 43,
			},
			["time"] = 1621288206,
			["zone"] = "Orgrimmar - Valley of Honor",
			["about"] = {
				["TE"] = 1,
				["T1"] = {
					["TX"] = "{img:Interface\\PVPFrame\\Icons\\PVP-Banner-Emblem-13:64:64}\n\n{h3}{icon:inv_gizmo_goblinboombox_01:20} Theme Song:{/h3}\n{link*https://www.youtube.com/watch?v=9feUxKIqKmg*TAKE IT BACK! by Miracle of Sound}\n\n{h3}{icon:inv_enchanting_70_pet_pen:20} Art{/h3}\n{link*https://bit.ly/2YDOVco*Pekun after \"Cold Front I\"}\n{link*https://bit.ly/3bBgMzT*Pekun after \"Kalimdor in Flames\"}\n{link*https://cdn.discordapp.com/attachments/682961488071491606/755444257510392049/Pekun007FP_after_ColdFront_V2.png*Pekun's \"Cold Front II\" look}\n{link*https://www.argentarchives.org/files/gallery_image/Pekun_point1a.png*Pekun after the Gloomspire Campaign}\n\n\n\n{h2}{icon:achievement_garrison_invasion:20} Weapons{/h2}\nOn his back, Pekun carries a spear which looks to be heavily modified with titan tech.\n\nFastened to his belt are some sticks of dynamite.\n\nSwung across his shoulder is a makeshift flamethrower, which was obviously built from scrap metal and doesn't look very safe.\n\n{h2}{icon:garrison_greenarmor:20} Gear{/h2}\n\nMost of the time, Pekun wears sturdy plate armor and hidden from view, underneath his shirt, a chainmail jerkin. Even in his casual clothes.\n\nRarely he's seen with a helmet, opting more often to wear his goggles into battle, for the advantages they give him.\n\n\n\n{h3}{icon:inv_helmet_goggles_pandariatradeskill_d_01:20} Goggle features{/h3}\n- Night vision\n- Spyglass\n- Magnifying glass\n- Mist-piercing\n- Heat vision\n- ISO (Image Snap Optics)\n\n\n{h3}{icon:inv_misc_bag_09_black:20} Inventory (permanent){/h3}\n\n{icon:inv_misc_pocketwatch_01:25} Golden Pocket Watch - gift from Runcorn\n{icon:inv_firstaid_bandage:25} Bandages\n{icon:inv_misc_bomb_03:25} Three sticks of dynamite (one is blue)\n{icon:inv_misc_enggizmos_swissarmy:25} Goblin Army Knife Xtreme\n{icon:inv_tailoring_80_nylonthread:25} Battered Sewing kit\n{icon:inv_misc_book_03:25} Reused Notebook\n{icon:inv_archaeology_70_highborne_noblemansletteropener:25} Used pen\n{icon:inv_misc_rope_02:25} Mountaineering Rope\n{icon:inv_misc_enggizmos_rocketchicken:25} Two one-time-use rocket-propelled mail-chicken (shrunk)\n{icon:ability_siege_engineer_magnetic_lasso:25} Shrink ray\n{icon:inv_misc_ticket_tarot_heroism_01:25} Heroism Tarot Card\n\n{icon:inv_feather_13:25} A hand full of owlkin feathers.\n{icon:inv_misc_felsaber_claw:25} Claw of an undead dragon.\n- A few teeth, claws and a shoulder blade of a different undead dragon.\n- A mecha dragon's toe\n- A wristwatch with radio functionality\n- An ice pick with bone handle, engraved with \"Ashen Ghost\"\n\n{icon:inv_engineering_mechabond imprint matrix:25}A cat collar with a bell on it.\n\nMedal of Stygian Annihilation\n\n\n\n\n{img:Interface\\PVPFrame\\Icons\\PVP-Banner-Emblem-83:64:64}\n\n{h2}{icon:achievement_goblinhead:25} Looks{/h2}\nA Goblin of average hight, but physically fit as his profession requires, Pekun would look to the casual observer like the typical bruiser type.\nRecent battles managed to accumulate more injuries, and thus scars, than all his years as a merc - fighting highwaymen is obviously very different to fighting wars.\n\nThe most obvious eyesore is the scar covering half his jaw and chin, where a piece of flesh had been torn out and stitched back one. The only other one in his face is a bright (now healed) gash where his nose right was torn out.\n\nPekun's ear-cuff is concealing a sizable hole where a chunk is missing from his right ear. This is obviously the only scar he is actively trying to hide.\n\n\nSome cuts and burns are visible (but not obtrusive) on the Goblin's arms. Should one catch him without his armour though, one would find several stab- and shot wounds marring his torso and legs.\n\n\n{icon:inv_plate_raidwarriormythic_s_01chest:25}{icon:inv_misc_tabard_kezan:25}\nHis armor is usually kept in good shape, as is his tabard.\nThe only jewelry he wears (aside from his ear-cuff) are:\n\n{icon:inv_ring_80_03d:25} a single nose piercing\n{icon:inv_misc_necklace_bone02:25} an unobtrusive necklace, sporting several dragon teeth and claws, as well as a single owlkin feather.\n\n(gone) {icon:inv_6_0raid_necklace_3d:25} and an amulet holding a dark orb with a green demonic pattern in it's center - a glowing, purple eye gazing out of it. It's encased in gold - two bands which can be twisted either way, with some words engraved on one one of them.\n\n---\n{h2}{icon:ability_racial_bestdealsanywhere:20} Personality & Quirks{/h2}\n\nHaving spent most of his days as a neutral merc, he doesn't have a lot of faction pride for the Horde. But he's fiercely loyal to his friends and will go through hell and high water to defend them; be it against physical harm or merely verbal offences.\n\nLike many goblins, what Pekun lacks in physical size and strength, he makes up for with his ingenuity. He loves to tinker, especially when faced with a problem that needs to be overcome. One of the results of this are his patented one-time-use rocket-propelled mail-chickens.\n\n\n{h2}{icon:inv_misc_scrollunrolled03:20} History{/h2}\nAsk ic ;)\n\n\n{img:Interface\\QuestionFrame\\answer-warboard-classic-Wetlands:256:128}",
				},
