		["11292146219ouTY"] = {
			["character"] = {
				["CU"] = "Thinking up an evil plan for today.\n",
				["CO"] = "Open for possibly all kinds of Rp, up for ooc conversations, I answer questions - even stupid ones.\n\n\nI hope you're having an evil day today!",
				["RP"] = 2,
				["LC"] = "enUS",
