			["character"] = {
				["v"] = 54,
				["CO"] = "Feel free to come up and chat laddeh! Also i make Cookies, ask if ya want some IC\n11\n\nGhostform=Windwalk(invisibility)\n\nIn Need of Illegal goods? ask for Darkheart! Also, Darkhearts Hiring!\n",
