				["Koruz-ArgentDawn"] = 1,
			},
			["about"] = {
				["v"] = 18,
				["BK"] = 19,
				["TE"] = 1,
				["T1"] = {
					["TX"] = "\"Art\" by me - {link*https://imgur.com/a/R3tmAdA*Said Art}\n\"The Darkheart Company\" Also by me - {link*https://imgur.com/a/pW3MZdL*Darkhearts}\n{link*https://imgur.com/a/m44eR9O*Father's grief - Also by me aswell}\n{link*https://imgur.com/a/7MX1ZyP* Koruz's Return} - Guess who made it.\nI do comissions if ya want something simmilar to my thing, if ya want more examples of my work, feel free to whisper me.\n\n{h2:c}Past{/h2} {icon:inv_misc_scrollunrolled01:25}\n\nKoruz's past is long, but of more notable parts go as such. He was a legen among his clan - The burning blade - being one of the advisors the the chieftain. He has few sibling which he scarecely talks about, and also had a wife and dozen children. His wife died before the Orcs journeyed onto Azeroth, and his children now roam the world as adventurers and legends in their own right. Not long after the Orcish invasion, due to a certain incident Koruz went into Exile, becoming a hermit wandering about Azeroth, which is also the reason for his near nonexistant fel taint. However, after hearing of Thrall's and Rexxar's exploits and their attempts to reform the Horde, he made his way back to his former comrades, hoping to forge his honor anew, and make up for the sins of his past.\n\n{h2:c}Current events{/h2} {icon:inv_misc_scrollunrolled01c:25}\n\nThese days Koruz is part of the inner circle of Darkheart company, serving as it's secondary leader. Unfortunately at the end of the last campaign while attempting to save his comrades he was gunned down by a rogue ethereal, resulting in his arrival to the Shadowlands. After some time journeying and battling through the land of the dead, he managed to find a gateway that allowed him to return from the land of the damned.\nAfter his mind being overtaken by a dark presence he was forced to face his old allies in deadly combat, where he managed to expel the intruder from his mind, shattering it in the proccess, becoming a mindless wretch for some time. Not long ago he managed, through secretive means, to both restore his mind, and bring back the strength of his youth\n\n{h2:c}Appearance{/h2} {icon:achievement_character_orc_male_brn:25}\n\nKoruz is considered an elder among his kin, living for quite a long time, he gathered scars and marks across his body. However for an orc his age he is still strong and of good physique, making many wonder how mighty he was in his younger years. Even now not many orc can match his strenght, and fewer can match his skill with the blade. The only thing that truly betrays him to his true age is his hair, as it's unmistakingly silver color stands quite out. Hidden under his bandages and leather straps, in the middle of his chest a medium sized star shaped scar\n\n{h2:c}Personality{/h2}\nKoruz's personality can be strange to some. For most people he may seem rough around the edges, still more accomodating and less aggresive than a normal orc. Speaking in a more rough tone, and preffering to speak as little as nescessary to people he doesen't know. To his fellows and people who he takes pity upon, his personality becomes quite different. His voices smoothens out taking on more of a caring tone, and becomes more soft. His overall demeanor changes that to a caring father.\n\n{h2:c}Experimental{/h2}\n\n5 HP\n1 Mana\n4 Adrenaline\n\nTrait: Garrosh did nothing wrong!\n",
