		["0508184703DXScw"] = {
			["character"] = {
				["CU"] = "",
				["CO"] = "Goblins & mechanics, feel free to recognize her from magazines and pinup calendars.\nArt has been added to About!",
				["RP"] = 1,
				["LC"] = "enUS",
