			["about"] = {
				["v"] = 18,
				["BK"] = 1,
				["TE"] = 1,
				["T1"] = {
					["TX"] = "{h1}Physical Description{/h1}\nStood at a wonderful average, {col:ec66e5}Kitty{/col} didn't strike an imposing figure, her skin almost glowing with its {col:24f624}vibrant, lime-green hue.{/col} From her hair to her feet, she styles herself to draw eyes and attention from those around her. Her hair is {col:d3d89a}bleached{/col} and well kept, somehow not having lost its thickness from the many chemical washings its gone through. It naturally steals one's eyes and lets them drift further across her button nose, something which she has no doubt had a fair few tries at working on, as well as her pleasant, {col:873a8e}pink stare.{/col} Her brows have been picked and finely treated to perfection, arching just between that awful point of constant surprise, and natural thickness. A constant pout adorns her lips, glossy with make-up as she often taps the thick pillows together, making soft little 'pop' noises as she thinks to herself. However hard she might try to hide it, her smiles always curve into toothy grins, betraying the fine gap between her front teeth, and the source of her lisp.\n\nA slender neck slopes down to a pair of slim shoulders. Often confined by an either far too well tailored top, or perhaps one that's purposefully set a bit too tight, is {col:ec66e5}Kitty's{/col} main moneymakers. Large and defiant of gravity, she seems quite proud of them! Though, asking her whether they're enhanced or not will probably earn you a few slaps and a proper wailing. A strict, constantly trend-chasing diet keeps her stomach flat and her waist beautifully shown off. Narrowing in nicely before flowing back out into a wide set of hips, while the curve is elegant, the junk in the trunk this goblin has is anything but(t). Filling out her clothes more than enough, she likes to strut it out in too-tight shorts and low-hanging overalls.\n{link*https://i.imgur.com/u1ygcVL.jpg*Art!}\n\n{h1}Personality{/h1}\n{col:ec66e5}Kitty{/col} is outwardly very extroverted, social, and friendly. She easily feels lonely when not around others and finds it hard to pass the time when not being social. She isn't inherently very skilled with engineering or swordsmanship, leading to her leaning even further into her looks and her personality to get by in life. ",
