					["TX"] = "Born in Silvemoon city, Elionor the Dutchess is a retired old woman. After having served Quel'thalas for almost a millenia, she still sometimes acts as a counsellor in her country and is respected for her age and status.\n\nElionor has spent most of her life in Quel'thalas or surrounded by Sin'dorei (formerly Quel'dorei), which means she is not very used to interacting with other races. Still, she is a fierce supporter of the Horde; not for her love for the Horde´s population but for the hatred she carries against humans, who apparently killed her son. She blames much of the misfortune of the Sin'dorei on the humans, considering them racist and careless, rotten behind that bright appearence of honesty and light. Given the chance, she would gladly attack Stormwind or any human cities to make them suffer. \n\nLady Elionor is a magic user and supporter, with vast knowledge in healing magic. her most interesting ability is her mana perception. She is extremelly skilled in this matter, being able to percieve people and to confuse them, attacking their senses altering her rival`s mana to create illusions. Unfortunately, she is not a warrior and she can´t do anything in a physical fight but surrounded by a group of allies, her healing abilities and her illusions make her a powerful force in battle.\n\nGlory to the Sin'dorei!\n\n{img:Interface\\FlavorImages\\BloodElfLogo-small:256:256}\n",
