				["CU"] = "HP: 4/8\nHunger: 1/3\nRusty Knife: +1 Damage\nMana: 3/3\nAdrenaline: 2/2\n+10 to charisma rolls\n+10 stealth rolls, +1 stealth dmg",
				["CO"] = "Approachable, yes.\n\nRecruitable, yes.\n\nHireable, yes.\n\nFightable, yes.\n\nTyping skills, so-so.\n\nERP-able, no.\n\nStealth is indeed sometimes IC!",
