						["AC"] = true,
						["TI"] = "Appearance",
						["TX"] = "A young Goblinette standing proud at around 3' 9\" of shapely proportions and muscular, well-toned physique. Her skintone is a pale green and her eyes are a piercing yellow. She has long black hair that is usually draped over her shoulders if not set up in some sort of ponytail or simple bun. ",
						["IC"] = "achievement_femalegoblinhead",
					},
					["4"] = {
						["AC"] = true,
						["TI"] = "Current Loadout",
						["IC"] = "battleground_strongbox_skirmish_horde",
						["TX"] = "Daggers x2 \nShivs x4 \nPistol \nBullets x12\nArcane Energy Blade",
					},
					["3"] = {
						["IC"] = "inv_60pvp_ring4a",
						["TI"] = "Piercings",
						["AC"] = true,
						["TX"] = "Her nose is pierced with studs and the right side of her lower lip has a small ring piercing. She often wears simple hoop earrings. Her belly button is adorned with a barbell and a small chain with a skull attached. All of her piercings are fashioned from truesilver.",
					},
					["2"] = {
						["AC"] = true,
						["TI"] = "Adventuring Gear",
						["TX"] = "Clad in an ensemble of primitive leather armour, mostly in a mix of dark blue and dark gray. Padded and patched with fur as well as decorated with various tusks and claws from formidable beasts. The shoulderpads has trophy tusks attached to them. Here and there her armour is decorated with small red gems. She also has various pouches and a bandolier strapped across her chest in convenient reach at a moment's notice when in the field.\n\nThe armor, despite stark in places is decorated with magically enchanted Mithril steel, offering further protection against harmful spells whilst empowering the wearer's own. \n\nThe red gems that are socketed in various parts of the armour are also enchanted with insulation enchantments, keeping the wearer's heat up and muffling the sound of their movements movements considerably.\n\nHer boots are also mechanically enhanced with a Goblin spring jumping mechanism to make the wearer able to make high leaps and across good distance.\n\nAnd last but not least she can by a snap of her fingers transmogrify her outfit from her usually bikinified suit to her full-body suit.",
						["IC"] = "inv_chest_leather_legionendgame_c_01",
					},
				},
				["ST"] = {
					["1"] = 4,
					["3"] = 3,
					["2"] = 3,
					["5"] = 4,
					["4"] = 3,
