				["v"] = 42,
			},
			["time"] = 1623363474,
			["zone"] = "Felwood - Irontree Clearing",
			["about"] = {
				["T2"] = {
					{
						["TX"] = "{h2:c}{col:6937ff}Appearance{/h2}{/col}\nA young Goblinette standing proud but slightly shorter than your average Goblin of shapely proportions and muscular, well-toned physique. Her skintone is a pale green and her eyes are a piercing yellow. She has long black hair that is usually draped over her shoulders if not set up in some sort of ponytail or simple bun. \n\nOn the road she is usually clad in cloth and leather for ease of movement while travelling and fighting. She is often wearing her go-to ensemble of a dark blue fur-decorated bikini with accompanying boots, gloves and shoulderpads decorated with beastly claws. A satchel, bandolier, face mask and hooded travelling cloak is also carried while adventuring. \n\nFor self-defence she carries a six-barreled pistol in a holster strapped to her right thigh, two mechanical daggers and a longsword resting its scabbard on her back. She also often has some type of rifle slung over her shoulder. Her main preference for fighting though is with her fists, having had history as a bruiser. She has installed hidden steel claws in her gloves that occasionally are coated with some kind of poison that can be extended and retracted at her leisure.",
						["BK"] = 1,
						["IC"] = "achievement_femalegoblinhead",
					}, -- [1]
					{
						["TX"] = "{h2:c}{col:6937ff}Background Report{/h2}{/col}\nNot many records exist on her life and upbringing back on Kezan. Aside from a seemingly brutal and primitive background in a small community deep in the wild jungles of Kezan with very shaky morals at its core like the rest of Goblin society. Judging by the sort of folks she mingles with from that time, it seems like they were specializing in business as assassins, reavers, witches, doctors and warlocks. \n\nShe, or at least the aftermath of her gruesome yet highly efficient work has been sighted on numerous occasions throughout the years in the Kingdoms in old Lordaeron and Khaz Modan.\n\nAs of late, she seems to be operating mainly in the jungles of Stranglethorn and Booty Bay, but has been rumored to conduct business elsewhere in Kalimdor and the Eastern Kingdoms, with one or two trips to Freeport in Kul Tiras and the swamps of Nazmir, taking an interest in hunting blood trolls for the Horde and local Zandalari.",
						["BK"] = 1,
						["IC"] = "inv_misc_book_11",
					}, -- [2]
					{
						["TX"] = "{h2:c}{col:6937ff}Themes{/h2}{/col}\n{h2:c}{link*https://www.youtube.com/watch?v=Uw0chMSX1HY*Wendy Rule - Everywhere and Nowhere}{/h2}\n{h2:c}{link*https://www.youtube.com/watch?v=ZY7DeoTgKJI*The Meteors - Blue Sunshine}{/h2}\n{h2:c}{link*https://www.youtube.com/watch?v=BdMp6JSkqh0*Witches in Bikinis - Witches in Bikinis}{/h2}\n{h2:c}{link*https://www.youtube.com/watch?v=Ck2Jx65rtUU*Hellripper - The Affair Of The Poisons}{/h2}\n",
						["BK"] = 1,
						["IC"] = "trade_archaeology_delicatemusicbox",
					}, -- [3]
