						["IC"] = "inv_70_pvp_ring1c",
						["TX"] = "Upon his left hand sits a simple ring, silver and plain but very much well loved. \n\nAround his wrist dangles a silver bangle inscribed with strange markings. \n\nLastly, around his neck hangs a locket, likely gifted and very precious containing two photos inside.\n",
