						["AC"] = true,
						["TI"] = "Armed",
						["IC"] = "inv_legendary_gun",
						["TX"] = "A dwarven flintlock pistol is holstered at all times on his left leg, engraved with two initials. \n\nOne hip carries a decadant sword, light and quick, the other an expensive dagger, a fel crystal inlaid in it's pommel.",
