			["time"] = 1623346038,
			["link"] = {
				["Talîsyn-ArgentDawn"] = 1,
			},
			["about"] = {
				["T1"] = {
					["TX"] = "{img:Interface\\QUESTFRAME\\UI-HorizontalBreak:256:64}\n\n{col:ffab1b}Once forever muck covered and dirty, old habits have been scrubbed after rumoured time spent 'recovering' in the Spire. Finally caught for a multitude of crimes, more likely, he has now been shaped and moulded to a Thalassian citizen, a sin'dorei patriot, except when safe and unheard of course. This time has gifted him awkward twitches, nervous ticks bred of distrust and mistreatment that he cannot now shake.\n\nIn his eyes swims a fair amount of story; and more weight than one so young should carry on his shoulders - his right ear has been sliced at the top, the pointed tip of it entirely removed and now resembling a crescent, perhaps a gift bestowed on him for his trade. When the eyepatch is not worn, his right eye appears unmoving and unblinking, lacking a fel glow and shines as if glass. One of the many stories written upon his face is that of the thin sliver of silver that bisects his upper lip, the tale of which is up for much debate and embellishment, but even the most experienced at escaping authorities can fall victim to bottles and bar fights.\n\nLoud and often obnoxious, with his own charm and confidence; Tal is not to everyone's tastes. He often lacks tact which he tries to offset with wit, but hardly ever lacks good intention, even with his own brand of cockiness - the smile he throws around is genuine and one for all, as harmless as anything that hails from Booty Bay.{/col}\n\n\n{img:Interface\\LFGFRAME\\UI-LFG-BACKGROUND-Islands:256:128}\n\n\n\n",
