			["about"] = {
				["v"] = 43,
				["BK"] = 6,
				["TE"] = 1,
				["T1"] = {
					["TX"] = "{h2:c}ART{/h2}\n{p:c}Artwork marked with \"*\" means the picture or drawing is in Thyuno's possession ICly, as well.{/p}\n\n{link*https://ibb.co/m57t3NP*Reading} by {link*https://www.deviantart.com/thevartoz*TheVartoz}\n{link*https://ibb.co/c1kmHh2*Spirit Magic} by {link*https://www.deviantart.com/thevartoz*TheVartoz}\n{link*https://ibb.co/N36DwVM*Spirit Magic 2} by {link*https://www.deviantart.com/thevartoz*TheVartoz}\n{link*https://ibb.co/M7BDhbZ*Thyuno Headshot}* by Remuru-ArgentDawn (Rem)\n\n{h2:c}APPEARANCE{/h2}\n\n{p:c}Thyuno is a very small Vulpera. Smaller than even the average vixen, he stands at a mere 3’7” (111cm). His body is very petite, seeming far more feminine than masculine, leading many to confuse him for a female, rather than a male.\nThough two things that stand out as larger than average on him are his ears and his tail. His ears are absolutely massive, far bigger than what would be considered ‘average’ among the Vulpera, and they portray a lot of his emotion. Continuous twitching, lowering and flapping of the ears is a very common thing in Thyuno, and alongside his tail, the easiest giveaway on how he might be feeling.\nHis tail, as mentioned, is a little longer than the average Vulpera’s, too. It stretches out as far as the rest of his body (minus the head) combined, and it often betrays his emotions, as well. Wagging, tucking in between his legs – his ears and his tail are full of body language.\nHis very thin and frail body is complemented by his very fluffy dark-gray and white fur with black stripes that he very regularly takes proper care of. He makes sure it is always neatly washed and thoroughly brushed. And it is particularly fluffy on his tail and on his face.\nThyuno’s face is male, but very, very effeminate, thus leading even Vulpera to need to take a second look before being sure. He has a rather long, but delicate snout, with a very, very small nose at the end that constantly seems to sniffle the air, like a bunny. His eyes are always covered with a thin layer of freshly-applied kohl. They’re hazel-coloured, and often appear very sensual in emotion.\nHe prefers to wear dresses and robes that complement his femininity, fully embracing it and being himself, and coupled together with his very soft voice, it is clear that Thyuno is one very small and delicate Vulpera at first glance. But looks can be deceiving, as those who make him their enemy might regret judging a book by its cover.\n{/p}\n\n{h2:c}OTHER USEFUL LINKS{/h2}\n\nCharacter theme 1: {link*https://www.youtube.com/watch?v=nxg4C365LbQ*Lorn - Acid Rain} Wonder why? Feel free to ask in /w!\nCharacter theme 2: {link*https://www.youtube.com/watch?v=ThOxIziVU-I*Woodju - Vacuum} Wonder why? Feel free to ask in /w!\n\n{h2:c}THYUNO ORIGINS{/h2}\n\n{p:c}Cold, harsh winds blew across Vol’dun that night, strewing the sands from the dunes across the coarse landscape of the desert. There was a faint scent of fire carried with it as the night cast its unforgiving and impenetrable veil over everything it touched. Two pairs of luminous eyes seemed exempt from that rule, however, as they gleamed in the dark, carried by two silhouettes that almost seemed to slither, had they not been in such a hurry. They stood next to a wagon which still billowed smoke into the air, making it clear where the scorching scent entwined with the winds. Urgent, but hushed voices could be heard at its entrance.\n    “Hurry!” hissed one of the silhouettes. “Take that foxss and be done with it!”\n    Spitefully, the other replied; “Korthek will have our headsss if we fail to take the otherssss!”\nAs they stared at each other for a brief moment to calculate their next move, looks of anger and defeat are plastered across their faces once they realise that running away is their only option.\nThey fled the scene, but not without a small, unconscious Vulpera kit that trailed behind them. It was clearly being dragged, creating small dents with its paws that were soon smoothened out by the everlasting winds which relentlessly shifted the sands. And as the silhouettes faded into the darkness, there was nothing but the sound of the wind that remained where the commotion occurred.\n\nTo be continued...\n\nInterested in what happens next? This is the beginning of a novella that I am writing called Thyuno Origins. Stay tuned as I will post the link to it here once it's finished - and reading it will be completely free of charge, of course. ^^{/p}",
				},
