			["about"] = {
				["T1"] = {
					["TX"] = "Lillys is a fast  huntress! \nShe´s a Dune Huntress of her caravan and is proud of what she dose best..hunting!\nWhen she first came to Ogrimmar, she was tired and lonley but happy she got away from Vol´Dun. \nBut she now lives a meaningful life with her caravan that she met in Ogrimmar, and finally feels like she found a home again.\n\n\nPersonality :\n\nLillys is a very happy little fox, always smiling. She has a low tolerance for others bullshit and cant stand grown people whining.\nHer favorite things to do, besides hunting and taking care of her animals, is dancing and partying. \nShe dose not worry much and will always help when she´s able to.\nThat also means helping the Horde...after all, they helped us (vulperan).\n\nFamily :\n\nLillys mate is Klianu,another hunter of the caravan.\nAnd their kit is named Sofie, a kit which they adopted.\n\n\n\n{img:Interface\\QUESTFRAME\\UI-HorizontalBreak:256:64}\n\nShop :\n\nLillys also sells a lot of leather, pelts, meats and other stuff she has left over from her hunts. She has her clientele in Ogrimmar mostly, but also shows up at diffrent markets. \n\n\nYou can order if you like anything specific or custom  made, such as diffrent meats and leather work. Prices are negotiable and always depends on what and how much you order.\n\n\n\nOBS (working on my TPR still) \n\n",
